<!doctype html><html lang="en"><head><meta charset="UTF-8"/><meta name="viewport" content="width=device-width,initial-scale=1"/><meta http-equiv="X-UA-Compatible" content="ie=edge"/><title>Nebula Suite</title><script src="https://cdn.jsdelivr.net/npm/regenerator-runtime@0.13.7/runtime.min.js"></script><meta name="importmap-type" content="systemjs-importmap"/><script type="systemjs-importmap">{
        "imports": {
          "single-spa": "https://cdn.jsdelivr.net/npm/single-spa@5.9.0/lib/system/single-spa.min.js"
        }
      }</script><link rel="preload" href="https://cdn.jsdelivr.net/npm/single-spa@5.9.0/lib/system/single-spa.min.js" as="script"/><script>var linkCss;
      createLinkCss = (url) => {
        linkCss = document.createElement('link');
        linkCss.href = url;
        linkCss.rel = 'stylesheet';
        linkCss.id = 'customCss';
        document.head.appendChild(linkCss);
      };

      deleteLinkCss = () => {
        document.head.removeChild(linkCss);
      };

      window.addEventListener('externalChangeCustomCss', (data) => {
        deleteLinkCss();
        createLinkCss(data.detail.url);
      });

      if (localStorage.getItem('nebulaSuiteCustomCss')) {
        createLinkCss(localStorage.getItem('nebulaSuiteCustomCss'));
      } else {
        var url = 'https://cdn.jsdelivr.net/npm/bootstrap@5.2.3/dist/css/bootstrap.min.css';
        createLinkCss(url);
      }</script><script type="systemjs-importmap">{
        "imports": {
          "@nebula/nebula-header": "https://devel.nebulaservice.net/header/main.js",
          "@nebula/nebula-menu": "https://devel.nebulaservice.net/menu/main.js",
          "@nebula/nebula-users": "https://devel.nebulaservice.net/users/main.js",
          "@nebula/nebula-login": "https://devel.nebulaservice.net/login/main.js",
          "@nebula/root-config": "https://devel.nebulaservice.net/nebula-root-config.js"
        }
      }</script><link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap-icons@1.10.3/font/bootstrap-icons.css"/><script src="https://cdn.jsdelivr.net/npm/zone.js@0.11.3/dist/zone.min.js"></script><script src="https://cdn.jsdelivr.net/npm/import-map-overrides@2.2.0/dist/import-map-overrides.js"></script><script src="https://cdn.jsdelivr.net/npm/systemjs@6.8.3/dist/system.min.js"></script><script src="https://cdn.jsdelivr.net/npm/systemjs@6.8.3/dist/extras/amd.min.js"></script></head><body><noscript>You need to enable JavaScript to run this app.</noscript><script>System.import('@nebula/root-config');</script><import-map-overrides-full show-when-local-storage="devtools" dev-libs></import-map-overrides-full></body></html>
